/* eslint-disable no-unused-vars */
import {useState} from 'react';
import BlogList from './BlogList';

const Home = () => {

    const [blogs, setBlogs] = useState([
        {title:'Entry No. 7', url:'asd.awds', id:1},
        {title:'A Rift In Time', url:'efsdf.asd', id:2},
        {title:'Pachinko', url:'asdasd.asd', id:3},
        {title:'Walk By The Shore', url:'ghsjk.sjdjks', id:4}
    ]);
    const [count, setCount] = useState(1);
    const event = () => {
        let r = Math.ceil(Math.random()*blogs.length);
        setCount(r);
    }
    
    return ( 
        <div className="home">
            <h2>Homepage - Drawings</h2>
            <button onClick={event}>Click here to view random drawings.</button>
            <br />
            <p>Drawings displayed: {count} - {count+3}</p>
            <BlogList blogs={blogs} />
        </div>
     );
}
 
export default Home;
